import React from 'react';
import Home from './Home';
import About from './About';
import{Route ,BrowserRouter as Router,Switch} from "react-router-dom";

function App() {
  return (  
   <Router>
     <div>hi</div>
     <Switch>
      <Route path="/" component = {Home}/>
      <Route path="/About" component={About}/>
      </Switch>
    </Router>  

  );
}
export default App;
